import React, { useEffect, useState } from "react";
import api from "./services/api";

export default function App() {
  const [users, setUserGet] = useState<any>([]);
  const nameUsers : Array<Object> = [];


  useEffect(() => {
   api
     .get("/v1/Users")
     .then((response) => ((setUserGet(response.data))))
     .catch((err) => {
       console.error("ops! ocorreu um erro" + err);
     });
  }, []);

  users.forEach((user: Object) => {
    nameUsers.push(user.name)
  });

  return (
    <div className="App">
      {nameUsers}
    </div>  
  );
}
